import React, { Component } from "react";

class YearEdition extends Component {
	render() {
		return(
			<div class="year-edition">
				<img src={require('./res/rallye'+this.props.year+'.png')} alt="" />
				<div>
					<p>{this.props.year}</p>
					<p>{this.props.theme}</p>
				</div>
	        </div>
		);
	}
}

export default YearEdition;
